2. [] Ï£ºÎ•ò Ï∂îÏ≤ú Í≤∞Í≥ºÎ•º whiteboxÎÇ¥Ïóê Íµ¨ÌòÑÌï† Í≤ÉÏù¥ÎØÄÎ°ú whiteboxÏûêÏ≤¥Î•º imageÎ°ú Ï≤òÎ¶¨ÌïòÏó¨ Í≤∞Í≥ºÍ≥µÏú†Í∞Ä Í∞ÄÎä•ÌïúÏßÄ, Ïï± ÏÑ§ÏπòÎßÅÌÅ¨?*/
import S from "./styled";
import styled from "styled-components";
import { useState, useEffect } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import logo from "../../image/bejuryu.png";
import authClient from "../../apis/authClient";
import noAuthClient from "../../apis/noAuthClient";
import { List, ListItem, ListItemText } from "@mui/material";

const StyledList = styled(List)`
  display: flex;
  //flex-direction: column;
  flex-wrap: wrap;
  align-items: center;
  //justify-content: space-between;
  //border: 1px solid #ccc;
  padding: 10px;
  font-family: "BejuryuFont";
`;

const StyledListItem = styled.li`
  border-bottom: 1px solid #ccc;
  padding: 10px;
  flex: 1 0 48%;

  & span {
    font-family: "BejuryuFont";
  }
`;

const StyledImage = styled.img`
  width: 100px;
  height: 150px;
  object-fit: cover;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0 auto;
`;

function Result() {
  const navigate = useNavigate();
  const location = useLocation();
  //const data = location.state?.data;

  const [jwtToken, setJwtToken] = useState("");
  const [imagePreview, setImagePreview] = useState(null);
  const [selectedFile, setSelectedFile] = useState(null);
  const [drinkInfo, setDrinkInfo] = useState(null);
  // Î∞õÏùÄ Îç∞Ïù¥ÌÑ∞ Ï†ÄÏû• ÏÉÅÌÉú
  const [resultData, setResultData] = useState(null);
  // drinkId ÏÉÅÌÉú
  const [drinkId, setDrinkId] = useState(null);

  // Ïù¥ÎØ∏ÏßÄ ÎîîÏΩîÎî© Ìï®Ïàò
  const decodeBase64 = (base64) => {
    const binaryString = window.atob(base64);
    const bytes = new Uint8Array(binaryString.length);
    for (let i = 0; i < binaryString.length; i++) {
      bytes[i] = binaryString.charCodeAt(i);
    }
    return URL.createObjectURL(new Blob([bytes.buffer], { type: "image/png" }));
  };
  // Ï£ºÎ•ò Ï∂îÏ≤ú Í≤∞Í≥º id
  const analysisId = location.state?.analysisId;

  // if (analysisId) {
  //   // analysisIdÍ∞Ä Ï†ïÏùòÎêú Í≤ΩÏö∞ Ïã§ÌñâÌï† ÏΩîÎìú
  //   console.log("analysisId:", analysisId);
  // } else {
  //   // analysisIdÍ∞Ä Ï†ïÏùòÎêòÏßÄ ÏïäÏùÄ Í≤ΩÏö∞ Ïã§ÌñâÌï† ÏΩîÎìú
  //   console.log("analysisId is undefined");
  // }

  // Ï£ºÎ•ò Ï∂îÏ≤úÍ≤∞Í≥º Î©òÌä∏
  const getSentence = (sentiment) => {
    switch (sentiment) {
      case "SAD_3":
      case "SAD_2":
      case "SAD_1":
        return {
          level: "Ïä¨Ìîî",
          comment:
            "ÌûòÎì§ ÌïòÎ£®ÏôÄ Ïä¨ÌîîÏùÑ ÎäêÎÅºÍ≥† ÏûàÎäî ÎãπÏã†ÏóêÍ≤å,\nÏà† Ìïú ÏûîÌïòÎ©∞, Ïä¨ÌîîÏù¥ ÏãúÎì§Ïñ¥Í∞Ñ ÎßàÏùåÏùÑ Îã§Ïãú ÌôúÍ∏∞Ï∞®Í≤å ÎßåÎì§Ïñ¥ Î≥¥Îäî Í≤ÉÏùÄ Ïñ¥Îñ®ÍπåÏöî?",
        };
      case "MEDIAN":
        return {
          level: "Ï§ëÎ¶Ω",
          comment:
            "ÏùºÏÉÅÏóêÏÑú Ï°∞ÌôîÏôÄ ÏïàÏ†ïÏùÑ ÎäêÎÅºÍ≥† ÏûàÎäî ÎãπÏã†ÏóêÍ≤å,\n Ïà† Ìïú ÏûîÌïòÎ©∞, Í∞ÄÎÅîÏùÄ ÌíÄÏñ¥ÎÇ¥Í≥† Ï¶êÍ±∞ÏõÄÏùÑ ÎçîÌï¥Î≥¥Îäî Í≤ÉÏùÄ Ïñ¥Îñ®ÍπåÏöî?",
        };
      case "HAPPY_1":
      case "HAPPY_2":
      case "HAPPY_3":
        return {
          level: "Í∏∞ÏÅ®",
          comment:
            "ÏùºÏÉÅ ÏÜçÏóêÏÑú ÌñâÎ≥µÏùÑ ÎßåÎÅΩÌïòÍ≥† ÏûàÎäî ÎãπÏã†ÏóêÍ≤å, \nÏà† Ìïú ÏûîÌïòÎ©∞, ÏßÄÍ∏à Ïù¥ ÏàúÍ∞ÑÏóê Ï¶êÍ±∞ÏõÄÏùÑ ÎçîÌï¥Î≥¥Îäî Í≤ÉÏùÄ Ïñ¥Îñ®ÍπåÏöî?",
        };
      default:
        return {
          level: "",
          comment: "",
        };
    }
  };

  useEffect(() => {
    // Í≤∞Í≥º Î∂àÎü¨Ïò§Í∏∞ ÏúÑÌïú Î°úÏßÅ
    const getSentiment = async () => {
      try {
        const response = await authClient({
          method: "get",
          url: `/analyze/${analysisId}`,
        });
        console.log(response);
        const data = response.data;
        console.log(data);
        setResultData(data);

        if (response) {
          console.log(response.data);
        }
      } catch (error) {
        console.error(error);
      }
    };

    if (analysisId) {
      getSentiment();
    }
  }, [analysisId]);

  const handleFormSubmit = (e) => {
    e.preventDefault();

    navigate("/result");
  };

  const [inputValue, setInputValue] = useState("");

  // Í≤∞Í≥º Í≥µÏú†
  const handleInputChange = (e) => {
    setInputValue(e.target.value);
  };

  const handleButtonClick = () => {
    navigate("/recommend");
  };

  return (
    <S.Container>
      <S.Wrapper>
        <S.Title>ü§óÎ∂ÑÏÑùÍ≤∞Í≥ºü§ó</S.Title>
        <S.WhiteBox>
          <S.Title>
            ÌòÑÏû¨ Í∞êÏ†ïÏùÄ {getSentence(resultData?.sentiment).level} ÏûÖÎãàÎã§.
          </S.Title>
          <StyledImage
            src={resultData && decodeBase64(resultData?.drinkImage)}
            alt="Ï£ºÎ•ò Ïù¥ÎØ∏ÏßÄ"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          />
          <StyledList>
            <StyledListItem>
              <ListItemText primary={resultData?.name} secondary="Ï£ºÎ•ò Ïù¥Î¶Ñ" />
            </StyledListItem>
            <StyledListItem>
              <ListItemText primary={resultData?.dosu} secondary="ÎèÑÏàò" />
            </StyledListItem>
            <StyledListItem>
              <ListItemText primary={resultData?.price} secondary="Í∞ÄÍ≤©" />
            </StyledListItem>
            <StyledListItem>
              <ListItemText primary={resultData?.type} secondary="Ï¢ÖÎ•ò" />
            </StyledListItem>
          </StyledList>

          <S.Text>
            BeJuryuÏùò comment: {getSentence(resultData?.sentiment).comment}
          </S.Text>
        </S.WhiteBox>

        <S.BtnList>
          <S.SubmitButton onClick={handleFormSubmit}>
            Í≤∞Í≥º Í≥µÏú†ÌïòÍ∏∞
          </S.SubmitButton>
          <S.SubmitButton onClick={handleButtonClick}>
            Îã§Ïãú Ï∂îÏ≤úÎ∞õÍ∏∞
          </S.SubmitButton>
        </S.BtnList>
      </S.Wrapper>
    </S.Container>
  );
}

export default Result;
